import React from "react";

export default function Card({name, img, type}){
    return(
        <div>
                <h3>{name}</h3>
                <img src={img} alt="img not found" width={"200px"} height={"250px"}/>
                <h4>Tipo</h4>
                <h5>{type}</h5>
                {
                    type?.map((el)=>{
                        
                        <h5>{el.name}</h5>
                    })
                }
                {/* <h5>{type[1]}</h5> */}
                
        
        </div>
        
    );
}
